import * as React from "react";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginPage.css';
import { Paper, Button, Box, FormControlLabel, Link } from "@mui/material";
import InputAdornment from '@mui/material/InputAdornment';

function LoginPage(){
    const handleSubmit = (event) =>{
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
            email: data.get('email'),
            password: data.get('password'),
        });
        console.log("hejka");
    };
    console.log("hej")

    return (<Paper  className="LoginPaper" sx={{width:400}} elevation={3}><Box component="form" action="/register" method="post" sx={{mt:5}} gap={5} display="flex" flexDirection="column" justifyContent="center">
        <h1 className="LogoHeader">Epinote</h1>
        <TextField InputProps={{startAdornment: <InputAdornment position="start">kg</InputAdornment>}} required autofocus label="E-mail" name="email" id="email" sx={{mr:5, ml:5}} variant="standard" size="small"/>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={3}> 
            <TextField required label="Password" name="password" id="password" type="password" variant="standard" size="small"/>
            <TextField required label="Confirm" name="passwordConfirm" id="passwordConfirm" type="password" variant="standard" size="small"/>
        </Box>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={5}> 
            <Link component={Button} variant="text" underline="none" href='/'>Sign In Instead</Link>
            <Button variant="contained" type="submit">Register</Button>
        </Box>
        </Box></Paper>);
}

export default LoginPage;



